import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Links() {
  return (
    <div className="bg-dark text-white">
      <Container fluid="md">
        <Row>
          <Col xs={12} md={4} className="mb-3">
            <h5>about</h5>
          </Col>
          <Col xs={12} md={4} className="mb-3">
            <h5>link</h5>
            <ul>
                <li>home</li>
                <li>about</li>
                <li>projects</li>
            </ul>
          </Col>
          <Col xs={12} md={4} className="mb-3">
            <h5>others</h5>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Links;
